import axios from "axios";

const BASE_URI = "http://localhost:8081";

export const testConnect = () => async () => {
    try {
        const res = await axios.get(`${BASE_URI}/test-connection`)
        console.log(res)
    } catch (error) {
        console.log(error)
    }
}
